import React, { useState, useEffect } from "react";
import { useNavigate } from 'react-router-dom';
import Manager_Product_List from "./Manager_Product_List";
import Manager_Add_Product from "./Manager_Add_Product";
import Manager_Orderding_List from "./Manager_Orderding_List";
import Manager_Profits from "./Manager_Profits";
import { Link, Outlet } from "react-router-dom";
import '../App.css';
export default function Client_Nav(props) {
    const [mystyle, setMystyle] = useState({});
    let navigate = useNavigate();
    useEffect(() => {
        setMystyle({
            color: "#3aedff",
            fontSize: "20px", marginLeft: "330px",
            marginTop: "70PX"
        });
    }, []);
    return (
        <div>
            <div class="sidebar">
                <div className="n">
                    <nav id="navs ">
                        <ul>
                            <li>
                                <a href="#">
                                    <span class="icon"><i class="fa fa-qrcode"></i></span>
                                    <span class="text">Dashboard</span>
                                </a>
                            </li>
                            </ul>
                            <a className="App-link" style={mystyle} onClick={() => { navigate(`/client/shopingCart`) }}>shopping-cart</a>
                            <Link className="App-link" style={mystyle} to={`/client`}>product-list</Link>
                            <Link className="App-link" style={mystyle} to={`/Log_Out`}>log out</Link>
                    </nav>
                    <Outlet />
                </div>
            </div>

        </div>);
}
